When Gotham City is plagued by a rash of bizarre crimes committed by the animal-inspired villain squad, the Animilitia (made up of Silverback, Cheetah, Killer Croc and Man-Bat), Batman swings into action to investigate. But could the Animilita be working for powerful businessman Oswald Cobblepot aka The Penguin? How does Cobblepot's new invention of robotic Cyber Animals fit into the mix? In the end, it'll take the combined forces of Batman, Green Arrow, Flash, Nightwing and Red Robin to fight off these.


Director: Butch Lukic
Writer: Heath Corson
Stars: Chris Diamantopoulos, Roger Craig Smith, Travis Willingham
Genres: Animation | Action | Adventure
Language: English

